"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[6171],{6171:e=>{e.exports=JSON.parse('{"en":{"main_title":"Apollo Belvedere","name":"Apollo Belvedere","author":"Giovanni Angelo","year":"130 BC","description":"This statue was part of the collection which Cardinal Giuliano della Rovere held in his palace in Rome. When he was elected Pope as Julius II the statues was transferred to the Vatican, where it has remained since at least 1508. The god, Apollo, moves forward majestically and seems to have just released an arrow from the bow which he originally carried in his left hand.","button":"3D"},"ua":{"main_title":"Аполлон Бельведерський","name":"Аполлон Бельведерський","author":"Джованні Анджело","year":"130 до н. е.","description":"Ця статуя була частиною колекції, яку кардинал Джуліано делла Ровере зберігав у своєму палаці в Римі. Коли він був обраний Папою як Юлій II, статуї були передані до Ватикану, де вони залишаються принаймні з 1508 року. Бог, Аполлон, велично рухається вперед і, здається, щойно випустив стрілу з лука, який він спочатку тримав у лівій руці.","button":"3D"},"es":{"main_title":"Apolo Belvedere","name":"Apolo Belvedere","author":"Giovanni Angelo","year":"130 aC","description":"Esta estatua formaba parte de la colección que el cardenal Giuliano della Rovere tenía en su palacio de Roma. Cuando fue elegido Papa como Julio II, las estatuas fueron trasladadas al Vaticano, donde ha permanecido desde al menos 1508. La dios, Apolo, avanza majestuosamente y parece haber lanzado una flecha del arco que originalmente llevaba en su mano izquierda","botón":"3D"},"specifical":{"authorLink":"giovanni-angelo"}}')}}]);